import React, { Component } from "react";

export default class Pay extends Component {
	render() {
		const {cartItem} = this.props;
		return (
			<div>
				{cartItem.length === 0 ? (
					<div>
						<h1>cart is empty</h1>
					</div>
				) : (
					<div>
						<h1>cart have: {cartItem.length} item</h1>
					</div>
				)}
                <div>
                    {cartItem.map((item)=>(
                        <div>
                            di
                            <h3>{item.name}</h3>
                            <img src={item.image} alt=""  width='100px'/>
                            <div>
                                <p>{item.type}</p>
                                <p>{item.rating}X{item.count}</p>
                            </div>
                            <button>remove</button>
                        </div>
                    ))}
                </div>
			</div>
		);
	}
}
